  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains annual quantities
  and value for all seafood products that are landed and sold by established seafood
  dealers and brokers in Florida.  These data are available on computer since the
  early 1960's.  The quantities and values that are reported in this data set include
  the annual landings for the period 1976 through 1996.  Monthly general canvass data
  are available for this period; however, the monthly data do not include information
  on the gear used and the fishing area.  The gear and fishing area information is
  only available for annual summaries of the general canvass data for the landings
  that occurred in Florida and this information is in the Florida Annual General Canvass.
  \ See the sections on Links for the reference to the monthly general canvass landings.\",\n\t\"license_title\":
